import React from 'react';
import { Route, Switch, Redirect } from "react-router-dom";
import './App.css';
import Navbar from './components/nav/navbar'

function App() {
  return (
    <div className="App">
      <switch>
        <Route path="/" component={Navbar} ></Route>
      </switch>


    </div>
  );
}

export default App;
